description:
Johnny is a brand new photographer doing a photo shoot for Phoenix's new job as a realtor. Johnny is having a few problems with the shots being blown out, luckily Phoenix was a photography before she got into real estate and has no problem showing Johnny how it is done. Photography isn't really Johnny's passion and he think that the job won't last too long but, Phoenix has an idea that he just needs a little inspiration. Phoenix drops to her knees and whips out Johnny's dick to blow him while he takes some shots of inspiration. Problem solved!

